const MyCard = () => {
  return (
    <div>
      <div className="imgbox">
        <img
          className="imgsize"
          src="../../assets/img/png-transparent-coca-cola-coca-cola-bottle-glass-bottles.png"
          alt=""
        />
      </div>
    </div>
  );
};

export default MyCard;
